/*Table structure for table `os_banner` */

DROP TABLE IF EXISTS `os_banner`;

CREATE TABLE `os_banner` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `catid` int(10) NOT NULL COMMENT 'Category',
  `name` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT 'Title',
  `alias` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT 'Alias',
  `banner` varchar(255) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'Banner',
  `clickurl` varchar(200) CHARACTER SET utf8 DEFAULT '' COMMENT 'Click URL',
  `description` text CHARACTER SET utf8 COMMENT 'Description',
  `published` tinyint(1) DEFAULT '1' COMMENT 'Status',
  `sticky` tinyint(1) DEFAULT '0' COMMENT 'Sticky',
  `ordering` int(11) DEFAULT '0' COMMENT 'Ordering',
  `created_on` datetime DEFAULT NULL COMMENT 'Created On',
  `created_by` int(11) DEFAULT NULL COMMENT 'Created By',
  `publish_up` datetime DEFAULT '0000-00-00 00:00:00' COMMENT 'Publish Up',
  `publish_down` datetime DEFAULT '0000-00-00 00:00:00' COMMENT 'Publish Down',
  PRIMARY KEY (`id`),
  KEY `idx_banner_catid` (`catid`),
  CONSTRAINT `os_banner_ibfk_1` FOREIGN KEY (`catid`) REFERENCES `os_banner_category` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `os_banner` */

/*Table structure for table `os_banner_category` */

DROP TABLE IF EXISTS `os_banner_category`;

CREATE TABLE `os_banner_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT 'Parent',
  `title` varchar(255) NOT NULL COMMENT 'Title',
  `alias` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT 'Alias',
  `description` mediumtext NOT NULL COMMENT 'Description',
  `published` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Published',
  `created_by` int(11) DEFAULT NULL COMMENT 'Created By',
  `created_time` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Created On',
  `modified_by` int(11) DEFAULT NULL COMMENT 'Modified By',
  `modified_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Modified On',
  PRIMARY KEY (`id`),
  KEY `cat_idx` (`published`),
  KEY `idx_alias` (`alias`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

