/*Table structure for table `os_content` */

DROP TABLE IF EXISTS `os_content`;

CREATE TABLE `os_content` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT 'Title',
  `alias` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT 'Alias',
  `introtext` text NOT NULL COMMENT 'Introtext',
  `fulltext` text NOT NULL COMMENT 'Full Text',
  `catid` int(10) NOT NULL COMMENT 'Category',
  `images` varchar(250) DEFAULT NULL COMMENT 'Image',
  `featured` tinyint(3) NOT NULL DEFAULT '0' COMMENT 'Featured',
  `ordering` int(11) NOT NULL DEFAULT '0' COMMENT 'Ordering',
  `state` tinyint(3) NOT NULL DEFAULT '1' COMMENT 'Status',
  `metakey` text NOT NULL COMMENT 'Meta Key',
  `metadesc` text NOT NULL COMMENT 'Meta Description',
  `hits` int(10) NOT NULL DEFAULT '0' COMMENT 'Hits',
  `created_by` int(10) NOT NULL DEFAULT '0' COMMENT 'Created By',
  `created` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Created On',
  `modified_by` int(10) NOT NULL DEFAULT '0' COMMENT 'Modified By',
  `modified` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Modified On',
  `publish_up` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Publish Up',
  `publish_down` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Publish Down',
  PRIMARY KEY (`id`),
  KEY `idx_state` (`state`),
  KEY `idx_catid` (`catid`),
  KEY `idx_createdby` (`created_by`),
  KEY `idx_featured_catid` (`featured`,`catid`),
  CONSTRAINT `os_content_ibfk_1` FOREIGN KEY (`catid`) REFERENCES `os_content_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

