/*Table structure for table `os_user` */

DROP TABLE IF EXISTS `os_user`;

CREATE TABLE `os_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) NOT NULL COMMENT 'Name',
  `username` varchar(150) NOT NULL COMMENT 'Username',
  `email` varchar(100) NOT NULL COMMENT 'Email',
  `password` varchar(100) NOT NULL COMMENT 'Password',
  `registerDate` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Register On',
  `lastvisitDate` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Last Visit',
  `activation` varchar(100) NOT NULL DEFAULT '' COMMENT 'Activation',
  `group_id` int(11) DEFAULT '0' COMMENT 'Group',
  `status` tinyint(1) DEFAULT NULL COMMENT 'Status',
  `user_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'User Type',
  PRIMARY KEY (`id`),
  KEY `idx_name` (`name`),
  KEY `username` (`username`),
  KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=1002 DEFAULT CHARSET=utf8;

