  `status` tinyint(1) DEFAULT NULL COMMENT 'Status',
  `user_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'User Type',
  PRIMARY KEY (`id`),
  KEY `idx_name` (`name`),
  KEY `username` (`username`),
  KEY `email` (`email`)
